    <h2 className="newlaunchtitle">Tesla ‘not a real automaker’ despite valuation: Toyoda</h2>
    <img src={'./avatars/bidcar.jpg'} style={{height:'130px',width:'100%'}} />

   </>

        )
    }
}
export default SubItems;
